                        <br/>
                        <h3>Anatomy of a City:<br/> Influence and Impact</h3>
                        <p><b>In any city, there is a delicate ecosystem of influence and impact.</b></p>
                        <p>While national government policies have a local impact, cities are increasingly able to influence these as a result of their economic and demographic clout.
                        </p>
                        <p>But cities’ policies on a range of issues are at least in part a response to city dwellers views and opinions, expressed directly and indirectly - views and opinions which are themselves shaped by the influence of traditional and social media.
                        </p>
                        <p>The relative weight of these influences varies from city to city, and understanding how to break in to these complex networks requires intelligence, insights and connections.</p>
